$(function(){$(".js-upload-photos").click(function(){$("#id_image").click()}),$("#id_image").fileupload({dataType:"json",sequentialUploads:!0,start:function(e){$("#uploadProgressBar").modal("show")},stop:function(e){$("#uploadProgressBar").modal("hide")},progressall:function(e,data){var progress,strProgress=parseInt(data.loaded/data.total*100,10)+"%";$(".progress-bar").css({width:strProgress}),$(".progress-bar").text(strProgress)},done:function(e,data){data.result.is_valid?$("tbody.images").prepend("<tr><td>"+data.result.url+"</td></tr>"):(data.result.limit_exceeded&&$("#error-alert").click(),$("tbody.images").prepend("<tr><td class='red-500'>Invalid data</td></tr>"))}})});